def get_age(x):
    f = float(x) # log age
    d = int(f)   # how many digits
    myr = d - 6  # how many myr
    p = f - d    # remainder
    x = 10.**p    # multiplier
    d1 = float(f"{x:.1f}")
    z = d1 * (10.**(myr+0.))
    return z

